import React from "react";
import styled from "styled-components";

function Errorpage() {
  const Wrapper = styled.div`
    min-height: 70vh;
    background-color: rgb(190, 188, 189);
  `;

  return <Wrapper>Errorpage</Wrapper>;
}

export default Errorpage;
